/*
 * Implement strStr().
 * Returns the index of the first occurrence of needle in haystack, or -1 if needle is not part of haystack.
 *
 * Tags:
 *  - Two Pointers
 *  - String
 */

/**
 * @param {string} haystack
 * @param {string} needle
 * @return {number}
 */
var strStr = function(haystack, needle) {
  // both haystack and needle are same
  if (haystack === needle) {
    return 0;
  }

  for (var i = 0; i < haystack.length - needle.length + 1; i++) {

    var isMatch = true;
    for (var j = 0; j < needle.length; j++) {
      if (haystack.charAt(i + j) !== needle.charAt(j)) {
        isMatch = false;
        break;
      }
    }

    if (isMatch === true) {
      return i;
    }
  }

  return -1;
};


// mocha testing
var expect = require('chai').expect;
describe('Implement strStr()', function() {

  it('haystack = xxxabcabcabc, needle = abc', function () {
    var input = {
      haystack: 'xxxabcabcabc',
      needle: 'abc'
    }
    var output = strStr(input.haystack, input.needle);

    expect(output).to.equal(3);
  });

  it('haystack = xxx, needle = yyy', function () {
    var input = {
      haystack: 'xxx',
      needle: 'yyy'
    }
    var output = strStr(input.haystack, input.needle);

    expect(output).to.equal(-1);
  });

  it('haystack = "", needle = ""', function () {
    var input = {
      haystack: '',
      needle: ''
    }
    var output = strStr(input.haystack, input.needle);

    expect(output).to.equal(0);
  });

  it('stress test', function () {
    this.timeout(100);

    var input = {
      haystack: '',
      needle: ''
    }
    var output = strStr(input.haystack, input.needle);

    expect(output).to.equal(-1);
  });
});
